export default async function PaperSheet() {
  const classes = useStyles();  
  const [list, setList] = useState(false);
  //axios call to get all transactions
  /* 
  useEffect(() => {
      let data=async()=>{
          //return await generateList()
      }
      setList(data)
  });
*/

  if(list===false){
    return (
      <div>
        <Paper className={classes.root}>
          <Typography variant="h5" component="h3">
            Transactions
          </Typography>
          <Typography component="p">
            Your Transactions
          </Typography>
          <List panels={list}/>
        </Paper>
      </div>
    );
  }
  else{
    return (
      <div>
        <Paper className={classes.root}>
          <Typography variant="h5" component="h3">
            Transactions
          </Typography>
          <Typography component="p">
            Your Transactions
          </Typography>
          <List panels={list}/>
        </Paper>
      </div>
    );
  }
}
